import React from "react";

const CreateUser = () => {
  return (
    <div className="Container">
      <h2> Add New User</h2>
      <form action="">
        <label htmlFor="id">ID:</label>
        <input type="text" id="id" name="id" />
      </form>
    </div>
  );
};

export default CreateUser;
